//订单管理
export default [{
    path: '/fmis',
    name: 'fmis',
    component: resolve => require(["@/views/index"], resolve),
    children: [
        //门店对账
        {
            path: '/show_statement',
            name: 'show_statement',
            component: resolve => require(["@/views/fmis/store/billwait/statement.vue"], resolve),
            meta: {
                title: '对账'
            }
        },
         //账单明细
        {
            path: '/show_billyet_check',
            name: '/show_billyet_check',
            component: resolve => require(["@/views/fmis/store/billyet/bill_yet_check.vue"], resolve),
            meta: {
                title: '账单明细'
            }
        },
        //网销收款对账下的账单明细
        {
            path: '/show_ditch_receipt_check',
            name: '/show_ditch_receipt_check',
            component: resolve => require(["@/views/fmis/other/ditchReceipt/ditch_receipt_check.vue"], resolve),
            meta: {
                title: '网销交易明细'
            }
        },
    ]
}]
